import { Redirect } from "react-router";

const Multiplayer = ({ token }) => {

if (!token) {
    return <Redirect to='/' />
}

    return (
        <form>
            <input  
            type='text'>
            placeholder='What would you like to say?'
            </input>
        </form>
    );
}

export default Multiplayer;
